import { AppProvider } from './context';

const App = () =>{ 

  return(
    <AppProvider>
    <div className="app">
     <Header/> 
     <Banner/>
     <RestaurantsLists/> 
     <RestaurantCard/>
     <Cart/>
    </div>
    </AppProvider>
  )
}


export default App;
